import React from 'react';
import './style.css';
import '../../assets/style/global.css';
import logo from '../../assets/imagens/logonegativo.png';

function Footer() {
  return (
      <div className="footer">
          <footer>
                <div>
                    <img src={logo} alt="logotipo preto do filmes collections"/>
                </div>
          </footer>
      </div>
  );
}

export default Footer;
